import React, { useState } from 'react';
import axios from 'axios';
import './view.css';


const Output = () => {
  const [circle, setCircle] = useState('');
  const [year, setYear] = useState('');
  const [month_of_year, setMonth] = useState('');
  const [fetchedData, setFetchedData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);


  const handleCircleChange = (e) => {
    setCircle(e.target.value);
  };

  const handleYearChange = (e) => {
    setYear(e.target.value);
  };

  const handleMonthChange = (e) => {
    setMonth(e.target.value);
  };




  const handleGetData = (e) => {
    e.preventDefault();

    // Prepare the API endpoint URL based on the selected options
    let apiUrl = `/view?circle=${circle}&year=${year}&month=${month_of_year}`;

    // Build the query parameters based on the selected search options
    const queryParams = {
      circle: circle,
      year: year,
      month_of_year: month_of_year,
    };

    // Convert the query parameters to a URL-encoded string
    const queryString = new URLSearchParams(queryParams).toString();

    // Append the query string to the API endpoint URL
    apiUrl += `?${queryString}`;

    // Make the API call using axios
    axios
      .get(apiUrl)
      .then((response) => {
        setFetchedData(response.data);
        setFilteredData(response.data);
        // Handle the response data here
        console.log(response.data); // This will log the data returned from the API
      })
      .catch((error) => {
        console.error('Error:', error); // Log the error if something went wrong
        // Optionally, you can handle the error or notify the user
      });
  };

    // Filter data based on search criteria
    const handleSearch = () => {
      const filteredResults = fetchedData.filter((item) => {
        if (circle && item.circle !== circle) return false;
        if (year && item.year !== year) return false;
        if (month_of_year && item.month_of_year !== month_of_year) return false;
        return true;
      });

      setFilteredData(filteredResults);
    };

  return (
    <div>
       <h1 className='makesure'>View Data</h1>
      <div className="choosing">

     <div>
     <form>
       <div className='bsbc'>
       <div className='dsdc'>
        <label>
          Circle:
          <input type='text' value={circle} onChange={handleCircleChange} />
        </label>
      </div>
      <div className='dsdc'>
        <label>
          Month:
          <input type='text' value={month_of_year} onChange={handleMonthChange} />
        </label>
      </div>
        <div className='dsdc'>
        <label>
          Year:
          <input type='number' value={year} onChange={handleYearChange} />
        </label>
      </div>
       </div>
        <button type="submit" className='getMore' onClick={handleSearch}>Get Output</button>
      </form>
     </div>
    </div>
    {fetchedData.length > 0 && (
      <div>
        <h2 className='tabledata'>Fetched Data</h2>
        <div className='table-container'>
          <table className='data-table'>
            <thead>
              <tr>
              <th>Circle</th>
              <th>Division</th>
              <th>Sub-Division</th>
                <th>Month</th>
                <th>Year</th>
                <th>Injection</th>
                <th>Unit Billed</th>
                {/* Add more table headers for other data fields */}
              </tr>
            </thead>
            <tbody>
              {fetchedData.map((item, index) => (
                <tr key={index}>
                  <td>{item.circle}</td>
                  <td>{item.division}</td>
                  <td>{item.subdivision}</td>
                  <td>{item.month_of_year}</td>
                  <td>{item.year}</td>
                  <td>{item.injection}</td>
                  <td>{item.unit_billed} </td>

                  {/* Add more table data cells for other data fields */}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    )}
    </div>
  );
};

export default Output;
